import React, { Fragment } from "react";
import Header from "./Header/Header";

const Layout = (props) => {
	return (
		<Fragment>
			<Header />
			<div className="layout">
				<div className="layout-inner">
					<main>{props.children}</main>
				</div>
			</div>
			<Footer />
		</Fragment>
	);
};

export default Layout;
